function initForm(){setupControls();loadNextEvents()}function setupControls(){$("#Detail").kendoWindow({visible:!1,modal:!0,scrollable:!0,title:"Detalle de Evento",width:1e3,actions:["Close"],refresh:onRefreshWindow,iframe:!1})}function loadNextEvents(){var n=+$("#next-event").val();n>0&&$.get(urlNext,{Initial:n},function(n){$("#next-event").val(n.next);$.each(n.items,function(n,t){var u,f,i,e,o,s,r,h,c;o=$("<span>").text(t.description);t.date=JSON.toDate(t.date);r=$("<span>").addClass("date");t.date.getHours()===0&&t.date.getMinutes()===0?r.text(kendo.toString(t.date,"dd/MM/yyyy")):r.text(kendo.toString(t.date,"dd/MM/yyyy HH:mm"));t.detail?(h=urlDetail+"/"+t.id,c=$("<a>").attr("href",h).text(t.name),e=$("<h4>").html(c)):e=$("<h4>").text(t.name);s=$("<input>").attr("type","hidden").val(t.id);f=$("<div>").addClass("box").addClass("color-"+(n+1)%5);i=$("<div>").addClass("inner-box");i.append(s);i.append(e);i.append(r);i.append("<br />");i.append(o);u=$("<div>").addClass("col-12").addClass("col-sm-6").addClass("col-md-4").addClass("col-lg-4");f.append(i);u.append(f);$(".box-container").append(u)});n.next==0&&$(".next").remove()})}function openEvent(n){n.preventDefault();var t=$("#Detail").data("kendoWindow");t.refresh({url:n.currentTarget.href});setTimeout(()=>t.open().center(),400)}$(()=>initForm());$(".next").click(()=>loadNextEvents());$(".box-container").on("click","a",n=>openEvent(n));